import { View, Text } from "react-native";

export const Investment = () => {
  return (
    <View
      style={{
        flex: 1,
        justifyContent: "center",
        alignItems: "center",
        backgroundColor: "#0B0B0B",
      }}
    >
      <Text style={{ color: "#fff" }}>Investment Coming Soon</Text>
    </View>
  );
};
